import React from 'react';
import styled from 'styled-components'

const Bodywrapper = styled.body `
    background-color: #2A2F36; 
    width: 80%;
    max-width: 3rem;


    h1 {
        font-family: 'Montserrat', sans-serif;

    }

`




function Body() {
  return (
      <Bodywrapper>
          <div>
            <h1> Hello world!</h1>
          </div>
      </Bodywrapper>

  );
}

export default Body;
